all_alarm.map:
function (doc, meta) {
  if (doc.Type == "SingalLightAlarm")
    emit([doc.Time, doc.IntersectionId], null);
}

all_intersection.map:
function (doc, meta) {
  if (doc.Type == "tbd.domain.Intersection")
    emit([doc.Source, doc.Name], {Name:doc.Name,
                                  LcType:doc.LcType, 
                                  Location:doc.Location,
                                  IntersectionId: doc.IntersectionId,
                                  DistinctName: doc.DistinctName,
                                  Source: doc.Source
                                 });
}

all_nameroad.map:
function (doc, meta) {
  if (doc.Type == "tbd.domain.NameRoad")
    emit([doc.Source, doc.Name,doc.From, doc.To], {
      Name: doc.Name,
      From: doc.From,
      To: doc.To,
      Source: doc.Source,
      NameRoadId: doc.NameRoadId,
      FromPoint: doc.FromPoint,
      ToPoint: doc.ToPoint,
      NeedLines: doc.Lines != null,
      District: doc.District,
    });
}

all_region.map:
function (doc, meta) {
  if (doc.Type == "tbd.domain.NameRegion")
    emit(doc.Source, {
      Name: doc.Name,
      Source: doc.Source,
      NameRegionId: doc.NameRegionId,

    });
}

all_accesslog.map:
function (doc, meta) {
  if (doc.Type && doc.Type == 'tbd.domain.AccessLog'){
    emit([doc.Time, doc.UserName], {Url: doc.Url, ResponseCode: doc.ResponseCode});
  }
}

all_function.map:
function (doc, meta) {
  if (doc.Type && doc.Type == 'tbd.domain.Appfunction'){
    emit([doc.ParentId,meta.id, doc.Name], null);
  }
}

